import React, { Component } from "react";
import styled from "styled-components";
import {Block, BlockTitle, List, ListItem, ListItemCell, Page, Navbar, Range } from 'framework7-react';
//import ReactSlider from "reactstrap";
//import styles from "react-dual-range-slider";

const Styles = styled.div`

`;

export default class Slider extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            min: 0,
            max: 500,
            priceMin: 100,
            priceMax: 300,
        }
    }
    

handleOnChange = (e) => this.setState({value: e.target.value})

    render(){
        return(
            <Styles >
                <input type="range" min={0} max={500} step={1} dual={true} value={[this.state.priceMin, this.state.priceMax]} className="slider" onChange={this.handleOnChange}/> 
                <div className="value">{this.state.value}</div>
            </Styles>
        )
    }
}
